        "title": "time@work rest api",
        "description": "internal rest api, used by time@work angular client",
        "contact": {
            "name": "man@home",
            "url": "https://gitlab.com/spare-time-demos/timeatwork",
            "email": "man.at.home@do-not-use-this-mail.com"
        },
        "license": {
            "name": "Apache 2.0",
            "url": "https://www.apache.org/licenses/LICENSE-2.0.txt"
        },
        "version": "0.1"
    },
    "externalDocs": {
        "description": "specs",
        "url": "https://gitlab.com/spare-time-demos/timeatwork/tree/master/docs/src/main/docs/features"
    },
    "servers": [
        {
            "url": "http://localhost",
            "description": "Generated server url"
        }
    ],
    "tags": [
        {
            "name": "ui-admin",
            "description": "ui: admin and team lead api calls"
        },
        {
            "name": "ui-user",
            "description": "ui: user api calls"
        },
        {
            "name": "security",
            "description": "login"
        },
        {
            "name": "admin",
            "description": "admin api, internal use"
        }
    ],
    "paths": {
        "/rest/admin/info": {
            "get": {
                "tags": [
                    "admin"
                ],
                "summary": "(dummy) application info endpoint.",
                "operationId": "info",
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "*/*": {
                                "schema": {
                                    "type": "string"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/rest/admin/job/usersync": {
            "get": {
                "tags": [
                    "admin"
                ],
                "summary": "start background job: usersync",
                "operationId": "startuserSync",
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "*/*": {
                                "schema": {
                                    "type": "string"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/authentication": {
            "post": {
                "tags": [
                    "security"
                ],
                "summary": "login with username and password, getting an jwt token on successful.",
                "operationId": "login",
                "requestBody": {
                    "content": {
                        "*/*": {
                            "schema": {
                                "$ref": "#/components/schemas/AuthenticationRequest"
                            }
                        }
                    }
                },
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "*/*": {
                                "schema": {
                                    "$ref": "#/components/schemas/AuthenticationResult"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/rest/project/": {
            "get": {
                "tags": [
                    "ui-admin"
                ],
                "summary": "retrieving all visible projects for current user.",
                "operationId": "getProjects",
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "type": "array",
                                    "items": {
                                        "$ref": "#/components/schemas/CProject"
                                    }
                                }
                            }
                        }
                    }
                }
            },
            "post": {
                "tags": [
                    "ui-admin"
                ],
                "summary": "create a new project.",
                "operationId": "createProject",
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/CProject"
                            }
                        }
                    }
                },
                "responses": {
                    "201": {
                        "description": "default response",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/CProject"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/rest/project/{projectId}": {
            "get": {
                "tags": [
                    "ui-admin"
                ],
                "summary": "retrieving a specific visible projects for current user.",
                "operationId": "getProject",
                "parameters": [
                    {
                        "name": "projectId",
                        "in": "path",
                        "description": "unique project id to find",
                        "required": true,
                        "schema": {
                            "type": "integer",
                            "format": "int64"
                        },
                        "example": "0185"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/CProject"
                                }
                            }
                        }
                    }
                }
            },
            "put": {
                "tags": [
                    "ui-admin"
                ],
                "summary": "change an existing project.",
                "operationId": "changeProject",
                "parameters": [
                    {
                        "name": "projectId",
                        "in": "path",
                        "description": "unique project id to change",
                        "required": true,
                        "schema": {
                            "type": "integer",
                            "format": "int64"
                        },
                        "example": "0815"
                    }
                ],
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/CProject"
                            }
                        }
                    }
                },
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/CProject"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/rest/project/{projectId}/task": {
            "get": {
                "tags": [
                    "ui-admin"
                ],
                "summary": "retrieving tasks for a specific project.",
                "operationId": "getProjectTasks",
                "parameters": [
                    {
                        "name": "projectId",
                        "in": "path",
                        "description": "project id to find tasks for",
                        "required": true,
                        "schema": {
                            "type": "integer",
                            "format": "int64"
                        },
                        "example": "0815"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "type": "array",
                                    "items": {
                                        "$ref": "#/components/schemas/CTask"
                                    }
                                }
                            }
                        }
                    }
                }
            },
            "post": {
                "tags": [
                    "ui-admin"
                ],
                "summary": "create a new task for an existing project",
                "operationId": "createTaskForProject",
                "parameters": [
                    {
                        "name": "projectId",
                        "in": "path",
                        "description": "project id for task to change",
                        "required": true,
                        "schema": {
                            "type": "integer",
                            "format": "int64"
                        },
                        "example": "0815"
                    }
                ],
                "requestBody": {
                    "description": "new task data",
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/CTask"
                            }
                        }
                    },
                    "required": false
                },
                "responses": {
                    "201": {
                        "description": "task created",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/CTask"
                                }
                            }
                        }
                    },
                    "403": {
                        "description": "not authorized as project lead or admin",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/CTask"
                                }
                            }
                        }
                    },
                    "404": {
                        "description": "project not found",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/ResponseStatusException"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/rest/task/{taskId}/assignment": {
            "get": {
                "tags": [
                    "ui-admin"
                ],
                "summary": "retrieving team member assignments for a specific task.",
                "operationId": "getTaskAssignments",
                "parameters": [
                    {
                        "name": "taskId",
                        "in": "path",
                        "required": true,
                        "schema": {
                            "type": "integer",
                            "format": "int64"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "type": "array",
                                    "items": {
                                        "$ref": "#/components/schemas/CTaskAssignment"
                                    }
                                }
                            }
                        }
                    }
                }
            },
            "post": {
                "tags": [
                    "ui-admin"
                ],
                "summary": "add a new assignment to an existing task.",
                "operationId": "createAssignment",
                "parameters": [
                    {
                        "name": "taskId",
                        "in": "path",
                        "required": true,
                        "schema": {
                            "type": "integer",
                            "format": "int64"
                        }
                    }
                ],
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/CTaskAssignment"
                            }
                        }
                    }
                },
                "responses": {
                    "201": {
                        "description": "default response",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/CTaskAssignment"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/rest/task/{taskId}": {
            "get": {
                "tags": [
                    "ui-admin"
                ],
                "summary": "retrieving a specific task.",
                "operationId": "getTask",
                "parameters": [
                    {
                        "name": "taskId",
                        "in": "path",
                        "required": true,
                        "schema": {
                            "type": "integer",
                            "format": "int64"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "*/*": {
                                "schema": {
                                    "$ref": "#/components/schemas/CTask"
                                }
                            }
                        }
                    }
                }
            },
            "put": {
                "tags": [
                    "ui-admin"
                ],
                "summary": "change an existing task.",
                "operationId": "changeTask",
                "parameters": [
                    {
                        "name": "taskId",
                        "in": "path",
                        "required": true,
                        "schema": {
                            "type": "integer",
                            "format": "int64"
                        }
                    }
                ],
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/CTask"
                            }
                        }
                    }
                },
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/Task"
                                }
                            }
                        }
                    }
                }
            },
            "delete": {
                "tags": [
                    "ui-admin"
                ],
                "summary": "delete an existing task.",
                "operationId": "deleteTask",
                "parameters": [
                    {
                        "name": "taskId",
                        "in": "path",
                        "required": true,
                        "schema": {
                            "type": "integer",
                            "format": "int64"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "type": "integer",
                                    "format": "int64"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/rest/task/{taskId}/assignment/{assignmentId}": {
            "put": {
                "tags": [
                    "ui-admin"
                ],
                "summary": "change from/until of given assignment",
                "operationId": "changeAssignment",
                "parameters": [
                    {
                        "name": "taskId",
                        "in": "path",
                        "required": true,
                        "schema": {
                            "type": "integer",
                            "format": "int64"
                        }
                    },
                    {
                        "name": "assignmentId",
                        "in": "path",
                        "required": true,
                        "schema": {
                            "type": "integer",
                            "format": "int64"
                        }
                    }
                ],
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/CTaskAssignment"
                            }
                        }
                    }
                },
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/CTaskAssignment"
                                }
                            }
                        }
                    }
                }
            },
            "delete": {
                "tags": [
                    "ui-admin"
                ],
                "summary": "delete an existing assignment from task",
                "operationId": "deleteAssignment",
                "parameters": [
                    {
                        "name": "taskId",
                        "in": "path",
                        "required": true,
                        "schema": {
                            "type": "integer",
                            "format": "int64"
                        }
                    },
                    {
                        "name": "assignmentId",
                        "in": "path",
                        "required": true,
                        "schema": {
                            "type": "integer",
                            "format": "int64"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "*/*": {
                                "schema": {
                                    "type": "integer",
                                    "format": "int64"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/rest/teammember": {
            "get": {
                "tags": [
                    "ui-admin",
                    "ui-user"
                ],
                "summary": "retrieving all known users.",
                "operationId": "getTeamMembers",
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "type": "array",
                                    "items": {
                                        "$ref": "#/components/schemas/CTeamMember"
                                    }
                                }
                            }
                        }
                    }
                }
            }
        },
        "/rest/workweek/{from-iso-date-string}": {
            "get": {
                "tags": [
                    "ui-user"
                ],
                "summary": "retrieving work week for given week, date format: /rest/workweek/YYYY-MM-DD.",
                "operationId": "getWorkWeek",
                "parameters": [
                    {
                        "name": "from-iso-date-string",
                        "in": "path",
                        "description": "date, start of week, format YYYY-MM-DD",
                        "required": true,
                        "schema": {
                            "type": "string"
                        },
                        "example": "2019-03-11"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/WorkWeek"
                                }
                            }
                        }
                    }
                }
            },
            "put": {
                "tags": [
                    "ui-user"
                ],
                "summary": "update work done for given week",
                "operationId": "updateWorkWeek",
                "parameters": [
                    {
                        "name": "from-iso-date-string",
                        "in": "path",
                        "description": "date, start of week, format YYYY-MM-DD",
                        "required": true,
                        "schema": {
                            "type": "string"
                        },
                        "example": "2019-03-11"
                    }
                ],
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/WorkWeek"
                            }
                        }
                    }
                },
                "responses": {
                    "200": {
                        "description": "default response",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "type": "integer",
                                    "format": "int32"
                                }
                            }
                        }
                    }
                }
            }
        }
    },
