                "type": "object",
                "properties": {
                    "userName": {
                        "type": "string"
                    },
                    "password": {
                        "type": "string"
                    }
                }
            },
            "AuthenticationResult": {
                "type": "object",
                "properties": {
                    "ok": {
                        "type": "boolean"
                    },
                    "message": {
                        "type": "string"
                    },
                    "token": {
                        "type": "string"
                    }
                }
            },
            "CProject": {
                "type": "object",
                "properties": {
                    "id": {
                        "type": "integer",
                        "format": "int64"
                    },
                    "name": {
                        "type": "string"
                    },
                    "active": {
                        "type": "boolean"
                    },
                    "projectLeads": {
                        "type": "array",
                        "items": {
                            "$ref": "#/components/schemas/CTeamMember"
                        }
                    }
                }
            },
            "CTeamMember": {
                "type": "object",
