            "CTaskAssignment": {
                "type": "object",
                "properties": {
                    "id": {
                        "type": "integer",
                        "format": "int64"
                    },
                    "task": {
                        "$ref": "#/components/schemas/CTask"
                    },
                    "teamMember": {
                        "$ref": "#/components/schemas/CTeamMember"
                    },
                    "from": {
                        "type": "string",
                        "format": "date"
                    },
                    "until": {
                        "type": "string",
                        "format": "date"
                    }
                }
            },
            "Project": {
                "required": [
                    "active",
                    "name"
                ],
                "type": "object",
                "properties": {
                    "id": {
                        "type": "integer",
                        "description": "unique project id.",
                        "format": "int64",
                        "example": 815
                    },
                    "name": {
                        "maxLength": 100,
                        "minLength": 1,
                        "type": "string",
                        "description": "unique descriptive name",
                        "example": "my unique project name"
                    },
                    "active": {
                        "type": "boolean",
                        "description": "is project active for administration by project lead.",
                        "example": true
                    },
                    "projectLeads": {
                        "type": "array",
                        "description": "project leads (administrator)",
                        "items": {
                            "$ref": "#/components/schemas/TeamMember"
                        }
                    }
                },
                "description": "tracked project."
            },
            "Task": {
                "required": [
                    "name",
                    "project",
                    "state"
                ],
                "type": "object",
                "properties": {
                    "id": {
                        "type": "integer",
                        "format": "int64"
                    },
                    "name": {
                        "maxLength": 100,
                        "minLength": 1,
                        "type": "string",
                        "description": "unique descriptive name",
                        "example": "first task: do something"
                    },
                    "state": {
                        "type": "string",
                        "enum": [
                            "PLANNED",
                            "ACTIVE",
                            "DONE"
                        ]
                    },
                    "project": {
                        "$ref": "#/components/schemas/Project"
                    }
                },
                "description": "a project task to be worked on."
            },
            "TeamMember": {
                "required": [
                    "name",
                    "userId"
                ],
                "type": "object",
                "properties": {
                    "id": {
                        "type": "integer",
                        "description": "unique internal member id",
                        "format": "int64",
                        "example": 4712
                    },
                    "name": {
                        "maxLength": 100,
                        "type": "string",
                        "description": "unique descriptive name",
                        "example": "Tom Teammember"
                    },
                    "userId": {
                        "maxLength": 100,
                        "type": "string",
                        "description": "unique descriptive name",
                        "example": "tlead1"
                    }
                },
                "description": "a team member, could be project lead or an member with assigned tasks."
            },
            "TaskWeek": {
                "type": "object",
                "properties": {
                    "taskId": {
                        "type": "integer",
                        "description": "task unique id",
                        "format": "int64"
                    },
                    "taskName": {
                        "type": "string"
                    },
                    "workHours": {
                        "type": "array",
                        "description": "7 days array of working hours",
                        "items": {
                            "$ref": "#/components/schemas/WorkHoursAssigned"
                        }
                    }
                },
                "description": "one week of working hours for a given task."
            },
            "WorkHoursAssigned": {
                "type": "object",
                "properties": {
                    "workHours": {
                        "type": "integer",
                        "description": "working hours done for given task on this day",
                        "format": "int32"
                    },
                    "readOnly": {
                        "type": "boolean",
                        "description": "current user is able to  change values for this day and task."
                    }
                },
                "description": "7 days array of working hours"
            },
            "WorkWeek": {
                "type": "object",
                "properties": {
                    "from": {
                        "type": "string",
                        "description": "start of week",
                        "format": "date",
                        "example": "2019-01-02"
                    },
                    "until": {
                        "type": "string",
                        "description": "last day of week",
                        "format": "date",
                        "example": "2019-01-08"
                    },
                    "taskWeeks": {
                        "type": "array",
                        "description": "list of tasks for this week",
                        "items": {
                            "$ref": "#/components/schemas/TaskWeek"
                        }
                    }
                },
